        "comment" : "<p>Returns whether the two strings are equal.</p> <p>This method compares each individual code unit of the strings. Equivalently (for strings that are well-formed UTF-16) it compares each individual rune (code point).  It does not check for Unicode equivalence. For example the two following strings both represent the string \"Amlie\" but, due to their different encoding will not return equal.</p> <pre><code>\"Am\\xe9lie\" \"Ame\\u{301}lie\" </code></pre> <p>In the first string the \"\" is encoded as a single unicode code unit (also a single rune), whereas the second string encodes it as \"e\" with the combining accent character \"\".</p>"
